import React, { useState } from 'react';
import { Tab, Tabs, Container, Box } from '@mui/material';

function RedTabs() {
  const [value, setValue] = useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Container>
      <Box sx={{ width: '300px' }}>
        <Tabs value={value} onChange={handleChange}>
          <Tab label="Tab 1" sx={{ color: 'white', backgroundColor: 'red' }} />
          <Tab label="Tab 2" sx={{ color: 'white', backgroundColor: 'red' }} />
          <Tab label="Tab 3" />
        </Tabs>
        {value === 0 && <div>Content for Tab 1</div>}
        {value === 1 && <div>Content for Tab 2</div>}
        {value === 2 && <div>Content for Tab 3</div>}
      </Box>
    </Container>
  );
}

export default RedTabs;
